('cllo16nwo0001eyx0apwhinbq', '"FACT: The growth of Paystack in Nigeria is not just a success story, it''s a testament to the limitless potential of Naija''s tech ecosystem. It''s proof that we can build globally competitive products right here at home. Kudos to the entire Paystack team. Keep pushing, keep disrupting! 🚀"', '0', '0', '0', '0', '0', '1692813053831', '11990002', 'tweet', '0', '0', '0', NULL, NULL),
('cllo4tz6e0003eyx0et21wvun', '"Being an alpha male is not about dominance or aggression, it''s about being confident, ambitious, and self-assured. In a world that demands resilience and determination, it''s time for men to embrace their true potential and lead with integrity. Let''s break stereotypes and redefine what it means to be a strong, successful man in today''s society. #AlphaMaleMindset"', '0', '0', '0', '0', '0', '1692819180374', '981201164', 'tweet', '0', '0', '0', NULL, NULL),
('cllo4urtf0005eyx03al368gd', '"In a society that praises strength, weak men aren''t appreciated. But strength isn''t all about muscles and wealth. It''s about principles, values, and the ability to stand up for what''s right. Our society needs to redefine what it means to be a strong man. It''s time for a change."', '0', '0', '0', '0', '0', '1692819217492', '981201164', 'tweet', '0', '0', '0', NULL, NULL),
('cllo4wk760007eyx0ejpcqb29', '"Internships are more than just a foot in the door; they''re an opportunity for growth and experience. So if you''re a Nigerian student looking to kickstart your career, don''t settle for anything less than the best. Seek out internships that challenge and inspire you. Trust me, the hustle will be worth it. 💪🏽🌟 #CareerGrowth #NigerianInterns"', '0', '0', '0', '0', '0', '1692819300930', '811086947003355100', 'tweet', '0', '0', '0', NULL, NULL),
('cllo4x71d0009eyx0wt6bit5j', '"Tech Bros aren''t just about coding and gadgets. They''re the new age warriors navigating the digital jungle, solving problems and innovating solutions. They''re not just shaping Nigeria''s tech landscape, they''re redefining the country''s economy. Keep up the grind, my Tech Bros!"', '0', '0', '0', '0', '0', '1692819330529', '811086947003355100', 'tweet', '0', '0', '0', NULL, NULL),
('cllo4xksq000beyx0hiuzvd3h', '"📚👨‍💻 Attention all aspiring tech enthusiasts! Forget about those outdated subjects in school. It''s time for Nigeria to step up and embrace the future. Introducing #AltSchool, where coding, programming, and design take center stage. 🚀🔥 Let''s equip our students with the skills they need to thrive in the digital age! 💪🇳🇬 #TechRevolution #EducationRevamp"', '0', '0', '0', '0', '0', '1692819348363', '811086947003355100', 'tweet', '0', '0', '0', NULL, NULL),
('cllo4ycxn000deyx06zvf1lsq', '"NIGERIAN POLITICS, a theatre of the ABSURD! Leaders who refuse to lead! Policies that stifle growth! Yet, amidst the chaos, we rise, we innovate, we push for better! Nigeria, we deserve MORE than this charade! #WakeUpNigeria"', '0', '0', '0', '0', '0', '1692819384827', '917606473341067300', 'tweet', '0', '0', '0', NULL, NULL),
('cllo50keh000feyx0gtf1tjfe', 'Wedding bells are ringing, but let''s not forget that the real power lies within us. We''re building empires, breaking barriers, and becoming the CEOs of our own lives. So while they''re planning their weddings, we''re planning our futures. 💪🏾✨ #BossBabe #WeddingBellsWho', '0', '0', '0', '0', '0', '1692819487817', '917606473341067300', 'tweet', '0', '0', '0', NULL, NULL),
('cllo5182b000heyx0koo9y9df', 'Just when you thought JavaScript couldn''t get any better, it goes and surprises us again! 💥 I''ve been diving deep into the world of JavaScript frameworks and let me tell you, it''s a game-changer for developers. The power and flexibility it offers are mind-blowing. 🚀 Who needs a superhero when you have JavaScript? #JavaScript #CodingNinja', '0', '0', '0', '0', '0', '1692819518484', '808248702401990700', 'tweet', '0', '0', '0', NULL, NULL),
